import React from 'react'
import "./Devices.css";

const Devices = (props)=>{
    render (
        <div>
            <div>
                <h1>Ladrillo Solar</h1>
            </div>
            <div>
                <h1>Casa Solar</h1>
            </div>           
            <div>
                <h1>Estación Metereológica</h1>
            </div>
        </div>
    );
  };

  export default Devices;
